import React from 'react';
import Container from 'react-bootstrap/Container'
import './Gallery.css';
import child from '../img/child.jpg';
import children from '../img/children.jpg';
import children2 from '../img/children_holding_hands.jpg';

const Gallery = () => {
  return (
    <Container style=  {{overflow : ''}}>
      <div className='gallery'>
        <div className='gallery-item'>
          <img src={child} alt="child"/>
          <h1>Create account</h1>
          <p>Create your own personal space - personal or organizational. Add content, publish your thoughts and have fun!</p>
        </div>
        <div className='gallery-item'>
          <img src={children} alt="children"/>
          <h1>Socialize</h1>
          <p>Connect with your friends, get to know new people, open new communities or join an existing one. Your journey begins here!</p>
        </div>
        <div className='gallery-item'>
          <img src={children2} alt="children_holding_hands"/>
          <h1>Help</h1>
          <p>Ask for something you need or offer what you can give. Contribute to the causes you believe in.  Join others in making a difference!</p>
        </div>
      </div>
    </Container>
  );
};

export default Gallery;
